// src/pages/Home.jsx
import React from "react";
import Navbar from "../components/Navbar";
import HeroSection from "../components/HeroSection";
import Footer from "../components/Footer";

const Home = () => {
    return (
        <div className="min-h-screen bg-gray-100 flex flex-col">
            <Navbar />
            <HeroSection />
            <div className="max-w-7xl mx-auto py-10 px-4 sm:px-6 lg:px-8">
                <h2 className="text-2xl font-bold text-gray-800">Why Choose Us?</h2>
                <p className="mt-4 text-gray-600">
                    Our platform is designed to make book sharing easy and enjoyable. Connect with fellow readers, exchange books, and foster a love for reading in your community.
                </p>
            </div>
            <Footer />
        </div>
    );
};

export default Home;
